import React from "react";
import { NavLink } from "react-router-dom";
import Contact from "../Con-tact";
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';

function Barnav() {
    return (
      <>
       <Navbar>
        <Container style={{backgroundColor: "transparent"}}>
        <Navbar.Brand >
            <img
              alt=""
              src="/images/8-removebg-preview.png"
              width="100"
              height="100"
              className="d-inline-block "
            />{' '}
           <span style={{ color: "#FFF5E4", fontWeight: "bold", fontSize: "1.2em", marginTop:"15px" }}> SOLUCIONES AMBIENTALES</span>
          </Navbar.Brand>
          <Nav className="mt-1">
            <Nav.Link to="/" style={{ color: "#FFF5E4", fontWeight: "bold", fontSize: "1.2em", marginTop:"15px" }}>INICIO</Nav.Link>
            <Nav.Link href="#features"style={{ color: "#FFF5E4", fontWeight: "bold", fontSize: "1.2em", marginTop:"15px" }}>NOSOTROS</Nav.Link>
            <Nav.Link to= <Contact/> style={{ color: "#FFF5E4", fontWeight: "bold", fontSize: "1.2em", marginTop:"15px" }}>CONTACTO</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
      
       </>
    );
  }
  
  export default Barnav;
